import React from "react";
import NavigationBar from "./components/NavigationBar";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
    return(
        <Router>
            <NavigationBar />
            <div align='center'>
                <Routes>
                    <Route exact path='/' Component={HomeComponent} />
                    <Route exact path='/db-upload' Component={dbUploadComponent} />
                    <Route exact path='/seq-upload' Component={SeqUpload} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
